    "High regression rate, high density hybrid fuels Project",nt"tracking_summary":
    {ntt"total": 14,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:49:28.395800",nt"name": "high-regression-rate-high-density-hybrid-fuels-project",nt"isopen":
    true,nt"url": null,nt"notes": "This SBIR program will investigate high
    energy density novel nanofuels combined with high density binders for use with an
    N2O oxidizer.  Terves has developed processes for stabilizing advanced high Isp
    fuels, such as LiBH4 to make them stable in thermoplastic binders such as PE.  If
    they combust efficiently and have suitable regression rates and stability, These
    materials can provide hybrid Isp's above 300 and density Isp's above 450 seconds
    with self-pressurizing N2O oxidizers, enabling very low cost propulsion systems
    to be designed.  This program will fabricate ultrafine- and nano- metal boride and
    hydride fuels, disperse them into high density binders, and evaluate their combustion
    efficiency in a hybrid test motor",nt"license_title": "U.S. Government Work",nt"extras":
